class SumSubsetsFormula:
    def __init__(self, d, subs_list, *keys_and_lambdas):
        assert(len(subs_list) == d)
        self.d = d
        self.subs_list = subs_list  # subsitution list
        self.keys_and_lambdas = keys_and_lambdas
    
    def calcluate_sum_subsets(self, n):
        assert (n % self.d == 0), "n is not multiple of d in SumSubsetsFormula.calcluate_sum_subsets"
        values = {}
        for arg in self.keys_and_lambdas:
            values[arg[0]] = arg[1](n)
        r = sp.zeros(self.d, 1)
        for i, v in enumerate(self.subs_list):
            r[i, 0] = values[v]
        return r


